import React, { useEffect, useState } from "react";
import LoadingBar from "../LoadingBar/LoadingBar";
import {
  Isprobaj,
  IsprobajResults,
  IsprobajWrapper,
  LoadingBarTitle,
  IsprobajInput,
  IsprobajResultsContainer,
  InputTemperatura,
  Select,
  Button,
} from "./IsprobajElements";

function Test() {
  const [barPercentage, setbarPercentage] = useState(2000);
  const [temperature, setTemperature] = useState("");
  const [loading, setLoading] = useState(false);

  const URL = "";

  const temperatureChange = (e) => {
    e.preventDefault();
    setTemperature(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setLoading(true);
  };

  useEffect(() => {
    setLoading(false);
    // fetch(URL)
    //   .then((res) => res.json())
    //   .then((data) => {
    //     console.log(data);
    //   });
    console.log("load");
  }, [loading]);

  return (
    <>
      <Isprobaj id="isprobaj">
        <IsprobajInput onSubmit={handleSubmit}>
          <InputTemperatura
            value={temperature}
            onChange={temperatureChange}
            placeholder="Temperatura"
            type="text"
            required
          ></InputTemperatura>
          <InputTemperatura
            onChange={temperatureChange}
            value={temperature}
            placeholder="Temperatura"
            type="text"
            required
          ></InputTemperatura>
          <InputTemperatura
            onChange={temperatureChange}
            value={temperature}
            placeholder="Temperatura"
            type="text"
            required
          ></InputTemperatura>
          <Select required>
            <option value="Wind" hidden>
              Type
            </option>
            <option value="Wind1">Wind1</option>
            <option value="Wind1">Wind1</option>
            <option value="Wind1">Wind1</option>
            <option value="Wind1">Wind1</option>
          </Select>
          <Button type="submit">Submit</Button>
        </IsprobajInput>
        <IsprobajResultsContainer id="test1">
          <IsprobajResults>
            <IsprobajWrapper>
              <LoadingBarTitle>Temperature</LoadingBarTitle>
              <LoadingBar
                min_progress="0"
                max_progress="6000"
                title="Temperature"
                done={barPercentage}
              />
            </IsprobajWrapper>
            <IsprobajWrapper>
              <LoadingBarTitle>Temperature</LoadingBarTitle>
              <LoadingBar
                min_progress="0"
                max_progress="6000"
                title="Temperature"
                done={barPercentage}
              />
            </IsprobajWrapper>
            <IsprobajWrapper>
              <LoadingBarTitle>Temperature</LoadingBarTitle>
              <LoadingBar
                min_progress="0"
                max_progress="6000"
                title="Temperature"
                done={barPercentage}
              />
            </IsprobajWrapper>
            <IsprobajWrapper>
              <LoadingBarTitle>Temperature</LoadingBarTitle>
              <LoadingBar
                min_progress="0"
                max_progress="6000"
                title="Temperature"
                done={barPercentage}
              />
            </IsprobajWrapper>
            <IsprobajWrapper>
              <LoadingBarTitle>Temperature</LoadingBarTitle>
              <LoadingBar
                min_progress="0"
                max_progress="6000"
                title="Temperature"
                done={barPercentage}
              />
            </IsprobajWrapper>
          </IsprobajResults>
        </IsprobajResultsContainer>
      </Isprobaj>
    </>
  );
}

export default Test;
